-- Creazione del database se non esiste
CREATE DATABASE IF NOT EXISTS Inventario;

-- Selezione del database
USE Inventario;

-- Creazione della tabella Articolo se non esiste
CREATE TABLE IF NOT EXISTS Articolo (
    Id INT PRIMARY KEY AUTO_INCREMENT, -- Chiave primaria con incremento automatico
    Nome VARCHAR(255) NOT NULL, -- Nome dell'articolo
    Descrizione TEXT, -- Descrizione dell'articolo
    Prezzo DECIMAL(10, 2) NOT NULL, -- Prezzo con precisione di 2 decimali
    QuantitaDisponibile INT NOT NULL, -- Quantit√† disponibile
    CodiceSKU VARCHAR(50) NOT NULL UNIQUE, -- Codice SKU univoco
    Categoria VARCHAR(100), -- Categoria dell'articolo
    DataInserimento DATETIME NOT NULL DEFAULT GETDATE() -- Data di inserimento con valore predefinito corrente
);

